const Provider = ( props ) => {
    const fetchURL = 'https://jsonplaceholder.typicode.com/posts';

    const fetchData = async () => {
        const response = await fetch(fetchURL);
        const data = await response.json();
        console.log(data);
    }
}

export default Provider;
